When Rumpelstiltskin destroys the Magic Mirror and escapes to the modern world, the four princesses of &quot;Once Upon a Time&quot;-Cinderella, Sleeping Beauty, Snow White, and Rapunzel-are sucked through the portal too. Well-trained and endowed with magical powers, the four women must fight Rumpelstiltskin and his army of thralls before he enslaves everyone on Earth.

Director: Jeremy M. Inman
Writer: Jeremy M. Inman
Stars: Casper Van Dien, Rileah Vanderbilt, Milynn Sarley 
Genres: Action | Adventure | Fantasy | Sci-Fi
Country: USA
Language: English
